import React from "react";
import ReactDOM from "react-dom";
import { PDFViewer } from "@react-pdf/renderer";

const App = () => (
  <PDFViewer>
    <div>Hello</div>
  </PDFViewer>
);

ReactDOM.render(<App />, document.getElementById("root"));
